soap() ->
    <<"<?xml version=\"1.0\" encoding=\"UTF-8\" ?> \n<!-- \n \nCopyright 2001 - 2006, International Business Machines Corporation and Microsoft Corporation\nAll Rights Reserved\n\nLicense for WSDL 1.1 Binding Extension for SOAP 1.2 Schema Files\n\nThe Authors grant permission to copy and distribute the WSDL 1.1 Binding Extension for SOAP 1.2 Schema Files in any medium without fee or royalty as long as this notice and license are distributed with them.  The originals of these files can be located at:\n\nhttp://schemas.xmlsoap.org/wsdl/soap12/wsdl11soap12.xsd\n\nTHESE SCHEMA FILES ARE PROVIDED \"AS IS,\" AND THE AUTHORS MAKE NO REPRESENTATIONS OR WARRANTIES, EXPRESS OR IMPLIED, REGARDING THESE FILES, INCLUDING, BUT NOT LIMITED TO, WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, NON-INFRINGEMENT OR TITLE.  THE AUTHORS WILL NOT BE LIABLE FOR ANY DIRECT, INDIRECT, SPECIAL, INCIDENTAL OR CONSEQUENTIAL DAMAGES ARISING OUT OF OR RELATING TO ANY USE OR DISTRIBUTION OF THESE FILES.\n\nThe name and trademarks of the Authors may NOT be used in any manner, including advertising or publicity pertaining to these files or any program or service that uses these files, written prior permission.  Title to copyright in these files will at all times remain with the Authors.\n\nNo other rights are granted by implication, estoppel or otherwise.\n\n\n--> \n<xs:schema xmlns:xs=\"http://www.w3.org/2001/XMLSchema\"\n           xmlns:wsdl=\"http://schemas.xmlsoap.org/wsdl/\"\n           xmlns:wsoap12=\"http://schemas.xmlsoap.org/wsdl/soap12/\"\n           targetNamespace=\"http://schemas.xmlsoap.org/wsdl/soap12/\" >\n\n  <xs:import namespace = \"http://schemas.xmlsoap.org/wsdl/\" />\n\n  <xs:complexType name=\"tExtensibilityElementOpenAttrs\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsdl:tExtensibilityElement\" >\n        <xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n  <xs:element name=\"binding\" type=\"wsoap12:tBinding\" />\n  <xs:complexType name=\"tBinding\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tExtensibilityElementOpenAttrs\" >\n        <xs:attribute name=\"transport\" type=\"xs:anyURI\" use=\"required\" />\n        <xs:attribute name=\"style\" type=\"wsoap12:tStyleChoice\" use=\"optional\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n  <xs:simpleType name=\"tStyleChoice\" >\n    <xs:restriction base=\"xs:string\" >\n      <xs:enumeration value=\"rpc\" />\n      <xs:enumeration value=\"document\" />\n    </xs:restriction>\n  </xs:simpleType>\n\n  <xs:element name=\"operation\" type=\"wsoap12:tOperation\" />\n  <xs:complexType name=\"tOperation\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tExtensibilityElementOpenAttrs\" >\n        <xs:attribute name=\"soapAction\" type=\"xs:anyURI\" use=\"optional\" />\n        <xs:attribute name=\"soapActionRequired\" type=\"xs:boolean\" use=\"optional\" />\n        <xs:attribute name=\"style\" type=\"wsoap12:tStyleChoice\" use=\"optional\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n  <xs:element name=\"body\" type=\"wsoap12:tBody\" />\n  <xs:attributeGroup name=\"tBodyAttributes\" >\n    <!-- The encodingStyle attribute is now a single URI, instead of a list of URIs -->\n    <xs:attribute name=\"encodingStyle\" type=\"xs:anyURI\" use=\"optional\" />\n    <xs:attribute name=\"use\" type=\"wsoap12:useChoice\" use=\"optional\" />\n    <xs:attribute name=\"namespace\" type=\"xs:anyURI\" use=\"optional\" />\n  </xs:attributeGroup>\n  <xs:simpleType name=\"tParts\">\n    <xs:list itemType=\"xs:NMTOKEN\"/>\n  </xs:simpleType>\n  <xs:complexType name=\"tBody\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tExtensibilityElementOpenAttrs\" >\n        <xs:attribute name=\"parts\" type=\"wsoap12:tParts\" use=\"optional\" />\n        <xs:attributeGroup ref = \"wsoap12:tBodyAttributes\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n  \n  <xs:simpleType name=\"useChoice\" >\n    <xs:restriction base=\"xs:string\" >\n      <xs:enumeration value=\"literal\" />\n      <xs:enumeration value=\"encoded\" />\n    </xs:restriction>\n  </xs:simpleType>\n\n  <xs:element name=\"fault\" type=\"wsoap12:tFault\" />\n  <xs:complexType name=\"tFaultRes\" abstract=\"true\" >\n    <xs:complexContent>\n      <xs:restriction base=\"wsoap12:tBody\" >\n\t    <xs:attribute ref=\"wsdl:required\" use=\"optional\" /> \n        <xs:attribute name=\"parts\" type=\"wsoap12:tParts\" use=\"prohibited\" />\n\t\t<xs:attributeGroup ref=\"wsoap12:tBodyAttributes\" />\n      </xs:restriction>\n    </xs:complexContent>  \t\n  </xs:complexType>\n  <xs:complexType name=\"tFault\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tFaultRes\">\n        <xs:attribute name=\"name\" type=\"xs:NCName\" use=\"required\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n\n  <xs:element name=\"header\" type=\"wsoap12:tHeader\" />\n  <xs:attributeGroup name=\"tHeaderAttributes\" >\n    <xs:attribute name=\"message\" type=\"xs:QName\" use=\"required\" />\n    <xs:attribute name=\"part\" type=\"xs:NMTOKEN\" use=\"required\" />\n    <xs:attribute name=\"use\" type=\"wsoap12:useChoice\" use=\"required\" />\n    <xs:attribute name=\"encodingStyle\" type=\"xs:anyURI\" use=\"optional\" />\n    <xs:attribute name=\"namespace\" type=\"xs:anyURI\" use=\"optional\" />      \n  </xs:attributeGroup>\n  <xs:complexType name=\"tHeader\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tExtensibilityElementOpenAttrs\" >\n        <xs:sequence>\n          <xs:element ref=\"wsoap12:headerfault\" minOccurs=\"0\" maxOccurs=\"unbounded\" />\n        </xs:sequence>\n\t\t<xs:attributeGroup ref=\"wsoap12:tHeaderAttributes\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n  <xs:element name=\"headerfault\" type=\"wsoap12:tHeaderFault\" />\n  <xs:complexType name=\"tHeaderFault\" >\n\t<xs:attributeGroup ref=\"wsoap12:tHeaderAttributes\" />\n\t<xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n  </xs:complexType>\n\n  <xs:element name=\"address\" type=\"wsoap12:tAddress\" />\n  <xs:complexType name=\"tAddress\" >\n    <xs:complexContent>\n      <xs:extension base=\"wsoap12:tExtensibilityElementOpenAttrs\" >\n        <xs:attribute name=\"location\" type=\"xs:anyURI\" use=\"required\" />\n      </xs:extension>\n    </xs:complexContent>\n  </xs:complexType>\n\n</xs:schema>\n">>.

soap_envelope() ->
    <<"<!-- Schema defined in the SOAP Version 1.2 Part 1 specification\n     Recommendation:\n     http://www.w3.org/TR/2003/REC-soap12-part1-20030624/\n     $Id: soap-envelope.xsd,v 1.2 2006/12/20 20:43:36 ylafon Exp $\n\n     Copyright (C)2003 W3C(R) (MIT, ERCIM, Keio), All Rights Reserved.\n     W3C viability, trademark, document use and software licensing rules\n     apply.\n     http://www.w3.org/Consortium/Legal/\n\n     This document is governed by the W3C Software License [1] as\n     described in the FAQ [2].\n\n     [1] http://www.w3.org/Consortium/Legal/copyright-software-19980720\n     [2] http://www.w3.org/Consortium/Legal/IPR-FAQ-20000620.html#DTD\n-->\n<xs:schema xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" xmlns:tns=\"http://www.w3.org/2003/05/soap-envelope\" targetNamespace=\"http://www.w3.org/2003/05/soap-envelope\" elementFormDefault=\"qualified\">\n\n  <xs:import namespace=\"http://www.w3.org/XML/1998/namespace\" schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\n\n  <!-- Envelope, header and body -->\n  <xs:element name=\"Envelope\" type=\"tns:Envelope\"/>\n  <xs:complexType name=\"Envelope\">\n    <xs:sequence>\n      <xs:element ref=\"tns:Header\" minOccurs=\"0\"/>\n      <xs:element ref=\"tns:Body\" minOccurs=\"1\"/>\n    </xs:sequence>\n    <xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n  </xs:complexType>\n\n  <xs:element name=\"Header\" type=\"tns:Header\"/>\n  <xs:complexType name=\"Header\">\n    <xs:annotation>\n\t  <xs:documentation>\n\t  Elements replacing the wildcard MUST be namespace qualified, but can be in the targetNamespace\n\t  </xs:documentation>\n\t</xs:annotation>\n    <xs:sequence>\n      <xs:any namespace=\"##any\" processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n    </xs:sequence>\n    <xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n  </xs:complexType>\n  \n  <xs:element name=\"Body\" type=\"tns:Body\"/>\n  <xs:complexType name=\"Body\">\n    <xs:sequence>\n      <xs:any namespace=\"##any\" processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n    </xs:sequence>\n    <xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/>\n  </xs:complexType>\n\n  <!-- Global Attributes.  The following attributes are intended to be\n  usable via qualified attribute names on any complex type referencing\n  them.  -->\n  <xs:attribute name=\"mustUnderstand\" type=\"xs:boolean\" default=\"0\"/>\n  <xs:attribute name=\"relay\" type=\"xs:boolean\" default=\"0\"/>\n  <xs:attribute name=\"role\" type=\"xs:anyURI\"/>\n\n  <!-- 'encodingStyle' indicates any canonicalization conventions\n  followed in the contents of the containing element.  For example, the\n  value 'http://www.w3.org/2003/05/soap-encoding' indicates the pattern\n  described in the SOAP Version 1.2 Part 2: Adjuncts Recommendation -->\n\n  <xs:attribute name=\"encodingStyle\" type=\"xs:anyURI\"/>\n\n  <xs:element name=\"Fault\" type=\"tns:Fault\"/>\n  <xs:complexType name=\"Fault\" final=\"extension\">\n    <xs:annotation>\n\t  <xs:documentation>\n\t    Fault reporting structure\n\t  </xs:documentation>\n\t</xs:annotation>\n    <xs:sequence>\n      <xs:element name=\"Code\" type=\"tns:faultcode\"/>\n      <xs:element name=\"Reason\" type=\"tns:faultreason\"/>\n      <xs:element name=\"Node\" type=\"xs:anyURI\" minOccurs=\"0\"/>\n\t  <xs:element name=\"Role\" type=\"xs:anyURI\" minOccurs=\"0\"/>\n      <xs:element name=\"Detail\" type=\"tns:detail\" minOccurs=\"0\"/>\n    </xs:sequence>\n  </xs:complexType>\n\n  <xs:complexType name=\"faultreason\">\n    <xs:sequence>\n\t  <xs:element name=\"Text\" type=\"tns:reasontext\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\n\t</xs:sequence>\n  </xs:complexType>\n\n  <xs:complexType name=\"reasontext\">\n    <xs:simpleContent>\n\t  <xs:extension base=\"xs:string\">\n\t    <xs:attribute ref=\"xml:lang\" use=\"required\"/>\n\t  </xs:extension>\n\t</xs:simpleContent>\n  </xs:complexType>\n  \n  <xs:complexType name=\"faultcode\">\n    <xs:sequence>\n      <xs:element name=\"Value\" type=\"tns:faultcodeEnum\"/>\n      <xs:element name=\"Subcode\" type=\"tns:subcode\" minOccurs=\"0\"/>\n    </xs:sequence>\n  </xs:complexType>\n\n  <xs:simpleType name=\"faultcodeEnum\">\n    <xs:restriction base=\"xs:QName\">\n      <xs:enumeration value=\"tns:DataEncodingUnknown\"/>\n      <xs:enumeration value=\"tns:MustUnderstand\"/>\n      <xs:enumeration value=\"tns:Receiver\"/>\n      <xs:enumeration value=\"tns:Sender\"/>\n      <xs:enumeration value=\"tns:VersionMismatch\"/>\n    </xs:restriction>\n  </xs:simpleType>\n\n  <xs:complexType name=\"subcode\">\n    <xs:sequence>\n      <xs:element name=\"Value\" type=\"xs:QName\"/>\n      <xs:element name=\"Subcode\" type=\"tns:subcode\" minOccurs=\"0\"/>\n    </xs:sequence>\n  </xs:complexType>\n\n  <xs:complexType name=\"detail\">\n    <xs:sequence>\n      <xs:any namespace=\"##any\" processContents=\"lax\" minOccurs=\"0\" maxOccurs=\"unbounded\"/>\n    </xs:sequence>\n    <xs:anyAttribute namespace=\"##other\" processContents=\"lax\"/> \n  </xs:complexType>\n\n  <!-- Global element declaration and complex type definition for header entry returned due to a mustUnderstand fault -->\n  <xs:element name=\"NotUnderstood\" type=\"tns:NotUnderstoodType\"/>\n  <xs:complexType name=\"NotUnderstoodType\">\n    <xs:attribute name=\"qname\" type=\"xs:QName\" use=\"required\"/>\n  </xs:complexType>\n\n\n  <!-- Global element and associated types for managing version transition as described in Appendix A of the SOAP Version 1.2 Part 1 Recommendation  -->  <xs:complexType name=\"SupportedEnvType\">\n    <xs:attribute name=\"qname\" type=\"xs:QName\" use=\"required\"/>\n  </xs:complexType>\n\n  <xs:element name=\"Upgrade\" type=\"tns:UpgradeType\"/>\n  <xs:complexType name=\"UpgradeType\">\n    <xs:sequence>\n\t  <xs:element name=\"SupportedEnvelope\" type=\"tns:SupportedEnvType\" minOccurs=\"1\" maxOccurs=\"unbounded\"/>\n\t</xs:sequence>\n  </xs:complexType>\n\n\n</xs:schema>">>.

xml() ->
    <<"<?xml version='1.0'?>\n<?xml-stylesheet href=\"../2008/09/xsd.xsl\" type=\"text/xsl\"?>\n<xs:schema targetNamespace=\"http://www.w3.org/XML/1998/namespace\" \n  xmlns:xs=\"http://www.w3.org/2001/XMLSchema\" \n  xmlns   =\"http://www.w3.org/1999/xhtml\"\n  xml:lang=\"en\">\n\n <xs:annotation>\n  <xs:documentation>\n   <div>\n    <h1>About the XML namespace</h1>\n\n    <div class=\"bodytext\">\n     <p>\n      This schema document describes the XML namespace, in a form\n      suitable for import by other schema documents.\n     </p>\n     <p>\n      See <a href=\"http://www.w3.org/XML/1998/namespace.html\">\n      http://www.w3.org/XML/1998/namespace.html</a> and\n      <a href=\"http://www.w3.org/TR/REC-xml\">\n      http://www.w3.org/TR/REC-xml</a> for information \n      about this namespace.\n     </p>\n     <p>\n      Note that local names in this namespace are intended to be\n      defined only by the World Wide Web Consortium or its subgroups.\n      The names currently defined in this namespace are listed below.\n      They should not be used with conflicting semantics by any Working\n      Group, specification, or document instance.\n     </p>\n     <p>   \n      See further below in this document for more information about <a\n      href=\"#usage\">how to refer to this schema document from your own\n      XSD schema documents</a> and about <a href=\"#nsversioning\">the\n      namespace-versioning policy governing this schema document</a>.\n     </p>\n    </div>\n   </div>\n  </xs:documentation>\n </xs:annotation>\n\n <xs:attribute name=\"lang\">\n  <xs:annotation>\n   <xs:documentation>\n    <div>\n     \n      <h3>lang (as an attribute name)</h3>\n      <p>\n       denotes an attribute whose value\n       is a language code for the natural language of the content of\n       any element; its value is inherited.  This name is reserved\n       by virtue of its definition in the XML specification.</p>\n     \n    </div>\n    <div>\n     <h4>Notes</h4>\n     <p>\n      Attempting to install the relevant ISO 2- and 3-letter\n      codes as the enumerated possible values is probably never\n      going to be a realistic possibility.  \n     </p>\n     <p>\n      See BCP 47 at <a href=\"http://www.rfc-editor.org/rfc/bcp/bcp47.txt\">\n       http://www.rfc-editor.org/rfc/bcp/bcp47.txt</a>\n      and the IANA language subtag registry at\n      <a href=\"http://www.iana.org/assignments/language-subtag-registry\">\n       http://www.iana.org/assignments/language-subtag-registry</a>\n      for further information.\n     </p>\n     <p>\n      The union allows for the 'un-declaration' of xml:lang with\n      the empty string.\n     </p>\n    </div>\n   </xs:documentation>\n  </xs:annotation>\n  <xs:simpleType>\n   <xs:union memberTypes=\"xs:language\">\n    <xs:simpleType>    \n     <xs:restriction base=\"xs:string\">\n      <xs:enumeration value=\"\"/>\n     </xs:restriction>\n    </xs:simpleType>\n   </xs:union>\n  </xs:simpleType>\n </xs:attribute>\n\n <xs:attribute name=\"space\">\n  <xs:annotation>\n   <xs:documentation>\n    <div>\n     \n      <h3>space (as an attribute name)</h3>\n      <p>\n       denotes an attribute whose\n       value is a keyword indicating what whitespace processing\n       discipline is intended for the content of the element; its\n       value is inherited.  This name is reserved by virtue of its\n       definition in the XML specification.</p>\n     \n    </div>\n   </xs:documentation>\n  </xs:annotation>\n  <xs:simpleType>\n   <xs:restriction base=\"xs:NCName\">\n    <xs:enumeration value=\"default\"/>\n    <xs:enumeration value=\"preserve\"/>\n   </xs:restriction>\n  </xs:simpleType>\n </xs:attribute>\n \n <xs:attribute name=\"base\" type=\"xs:anyURI\"> <xs:annotation>\n   <xs:documentation>\n    <div>\n     \n      <h3>base (as an attribute name)</h3>\n      <p>\n       denotes an attribute whose value\n       provides a URI to be used as the base for interpreting any\n       relative URIs in the scope of the element on which it\n       appears; its value is inherited.  This name is reserved\n       by virtue of its definition in the XML Base specification.</p>\n     \n     <p>\n      See <a\n      href=\"http://www.w3.org/TR/xmlbase/\">http://www.w3.org/TR/xmlbase/</a>\n      for information about this attribute.\n     </p>\n    </div>\n   </xs:documentation>\n  </xs:annotation>\n </xs:attribute>\n \n <xs:attribute name=\"id\" type=\"xs:ID\">\n  <xs:annotation>\n   <xs:documentation>\n    <div>\n     \n      <h3>id (as an attribute name)</h3> \n      <p>\n       denotes an attribute whose value\n       should be interpreted as if declared to be of type ID.\n       This name is reserved by virtue of its definition in the\n       xml:id specification.</p>\n     \n     <p>\n      See <a\n      href=\"http://www.w3.org/TR/xml-id/\">http://www.w3.org/TR/xml-id/</a>\n      for information about this attribute.\n     </p>\n    </div>\n   </xs:documentation>\n  </xs:annotation>\n </xs:attribute>\n\n <xs:attributeGroup name=\"specialAttrs\">\n  <xs:attribute ref=\"xml:base\"/>\n  <xs:attribute ref=\"xml:lang\"/>\n  <xs:attribute ref=\"xml:space\"/>\n  <xs:attribute ref=\"xml:id\"/>\n </xs:attributeGroup>\n\n <xs:annotation>\n  <xs:documentation>\n   <div>\n   \n    <h3>Father (in any context at all)</h3> \n\n    <div class=\"bodytext\">\n     <p>\n      denotes Jon Bosak, the chair of \n      the original XML Working Group.  This name is reserved by \n      the following decision of the W3C XML Plenary and \n      XML Coordination groups:\n     </p>\n     <blockquote>\n       <p>\n\tIn appreciation for his vision, leadership and\n\tdedication the W3C XML Plenary on this 10th day of\n\tFebruary, 2000, reserves for Jon Bosak in perpetuity\n\tthe XML name \"xml:Father\".\n       </p>\n     </blockquote>\n    </div>\n   </div>\n  </xs:documentation>\n </xs:annotation>\n\n <xs:annotation>\n  <xs:documentation>\n   <div xml:id=\"usage\" id=\"usage\">\n    <h2><a name=\"usage\">About this schema document</a></h2>\n\n    <div class=\"bodytext\">\n     <p>\n      This schema defines attributes and an attribute group suitable\n      for use by schemas wishing to allow <code>xml:base</code>,\n      <code>xml:lang</code>, <code>xml:space</code> or\n      <code>xml:id</code> attributes on elements they define.\n     </p>\n     <p>\n      To enable this, such a schema must import this schema for\n      the XML namespace, e.g. as follows:\n     </p>\n     <pre>\n          &lt;schema . . .>\n           . . .\n           &lt;import namespace=\"http://www.w3.org/XML/1998/namespace\"\n                      schemaLocation=\"http://www.w3.org/2001/xml.xsd\"/>\n     </pre>\n     <p>\n      or\n     </p>\n     <pre>\n           &lt;import namespace=\"http://www.w3.org/XML/1998/namespace\"\n                      schemaLocation=\"http://www.w3.org/2009/01/xml.xsd\"/>\n     </pre>\n     <p>\n      Subsequently, qualified reference to any of the attributes or the\n      group defined below will have the desired effect, e.g.\n     </p>\n     <pre>\n          &lt;type . . .>\n           . . .\n           &lt;attributeGroup ref=\"xml:specialAttrs\"/>\n     </pre>\n     <p>\n      will define a type which will schema-validate an instance element\n      with any of those attributes.\n     </p>\n    </div>\n   </div>\n  </xs:documentation>\n </xs:annotation>\n\n <xs:annotation>\n  <xs:documentation>\n   <div id=\"nsversioning\" xml:id=\"nsversioning\">\n    <h2><a name=\"nsversioning\">Versioning policy for this schema document</a></h2>\n    <div class=\"bodytext\">\n     <p>\n      In keeping with the XML Schema WG's standard versioning\n      policy, this schema document will persist at\n      <a href=\"http://www.w3.org/2009/01/xml.xsd\">\n       http://www.w3.org/2009/01/xml.xsd</a>.\n     </p>\n     <p>\n      At the date of issue it can also be found at\n      <a href=\"http://www.w3.org/2001/xml.xsd\">\n       http://www.w3.org/2001/xml.xsd</a>.\n     </p>\n     <p>\n      The schema document at that URI may however change in the future,\n      in order to remain compatible with the latest version of XML\n      Schema itself, or with the XML namespace itself.  In other words,\n      if the XML Schema or XML namespaces change, the version of this\n      document at <a href=\"http://www.w3.org/2001/xml.xsd\">\n       http://www.w3.org/2001/xml.xsd \n      </a> \n      will change accordingly; the version at \n      <a href=\"http://www.w3.org/2009/01/xml.xsd\">\n       http://www.w3.org/2009/01/xml.xsd \n      </a> \n      will not change.\n     </p>\n     <p>\n      Previous dated (and unchanging) versions of this schema \n      document are at:\n     </p>\n     <ul>\n      <li><a href=\"http://www.w3.org/2009/01/xml.xsd\">\n\thttp://www.w3.org/2009/01/xml.xsd</a></li>\n      <li><a href=\"http://www.w3.org/2007/08/xml.xsd\">\n\thttp://www.w3.org/2007/08/xml.xsd</a></li>\n      <li><a href=\"http://www.w3.org/2004/10/xml.xsd\">\n\thttp://www.w3.org/2004/10/xml.xsd</a></li>\n      <li><a href=\"http://www.w3.org/2001/03/xml.xsd\">\n\thttp://www.w3.org/2001/03/xml.xsd</a></li>\n     </ul>\n    </div>\n   </div>\n  </xs:documentation>\n </xs:annotation>\n\n</xs:schema>\n\n">>.
